import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Upload from './components/Upload';
import ProveMRC from './components/ProveMRC'; // Import the ProveMRC component

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={Upload} />
        <Route path="/prove-mrc" component={ProveMRC} />
      </Switch>
    </Router>
  );
}

export default App;
